import React from "react";
import { ReactSVG } from "react-svg";
import { LOGOSVG } from "/logo-220x63.svg";

class LogoSVG extends React.Component {
  render() {
    return <ReactSVG src={LOGOSVG} />;
  }
}

export default LogoSVG;
